import './App.css';
import Header from "./Header";
import Home from "./Home";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom"
import Checkout from './Checkout';


function App() {
  <Router>
    <div className="App">
      <Switch></Switch>
      <Route path="/Checkout">
        <Header />
        <Checkout />
      </Route >
      <Route path="/">
        <Header />
        <Home />
      </Route >
    </div>
  </Router>
}

export default App;
